import React from "react";
import Row from "./Row";
import TableHeader from "./TableHeader";

function Table({ tableHeader, rows, onEdit, onDelete }) {
  return (
    <table
      id="dtHorizontalExample"
      class="table table-striped table-bordered table-sm nowrap"
      cellspacing="0"
      width="100%"
    >
      <thead>
        <tr>
          <TableHeader tableHeader={tableHeader} />
        </tr>
      </thead>
      <tbody>
        {rows.map((row) => (
          <Row key={row.id} row={row} onEdit={onEdit} onDelete={onDelete} />
        ))}
      </tbody>
    </table>
  );
}

export default Table;
